INSERT INTO `global_property` VALUES ('addresshierarchy.addressToEntryMapUpdaterLastStartTime',NULL,'The module uses this field to store when the AddressToEntryMapUpdater task was last started; DO NOT MODIFY','a77fe3e5-0124-473c-a564-5735422a8ce0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.allowFreetext','true','Valid values: true/false. When overriding the address portlet, allow the entry of free text for address fields associated with the address hierarchy by providing an \"Other\" option','1fa784e4-e088-40be-9a9a-880fdb9ab9ec',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.database_version','2.10.0','DO NOT MODIFY.  Current database version number for the addresshierarchy module.','8d8cdb7f-f7a3-4a37-b67b-dabfd9d580e0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.enableOverrideOfAddressPortlet','true','Valid values: true/false. When enabled, the existing \"edit\" component of the address portlet is overridden by the new functionality provided by the address hierarchy module','552333ad-49bd-41a9-9072-9c3c784803f0',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.initializeAddressHierarchyCacheOnStartup','true','Sets whether to initialize the address hierarchy in-memory cache (which is used to speed up address hierarchy searches.\n            Generally, you want to set this to \"true\", though developers may want to set it to false during development\n            to speed module start-up.','8054f215-3af0-4e65-9742-761ffbc69d28',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.mandatory','false','true/false whether or not the addresshierarchy module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','c999f9dc-3833-4cec-831e-e68816ed7337',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.soundexProcessor',NULL,'If the Name Phonetics module is installed, this defines the name of a soundex algorithm used by the getPossibleFullAddresses service method.','3fe6dd93-7aa4-48b2-8fd7-7a98829cd6c1',NULL,NULL,NULL,NULL,NULL,NULL),('addresshierarchy.started','true','DO NOT MODIFY. true/false whether or not the addresshierarchy module has been started.  This is used to make sure modules that were running  prior to a restart are started again','b4de80fc-0fa4-4c60-80f6-72804bfe0262',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.allergen.ConceptClasses','Drug,MedSet','A comma-separated list of the allowed concept classes for the allergen field of the allergy dialog','f95f22e2-34ce-4837-abf1-485f9877f1cc',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.drug','162552AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the drug allergens concept','e380e339-50d2-4c77-81ce-37c7f4fa6ab5',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.environment','162554AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the environment allergens concept','93b3b208-01f9-4782-a5ce-cd5408c18956',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.allergen.food','162553AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the food allergens concept','3ba30c5c-5a0c-438a-84f0-75b1541ac3c0',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.otherNonCoded','5622AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy other non coded concept','0b945641-d90f-4d69-9071-b96c363f462a',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.reactions','162555AAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy reactions concept','0ef78fe3-8aae-41c9-afff-a7221752a12b',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.mild','1498AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the MILD severity concept','d46697a5-327e-4286-b0f6-5f68acfe6e6c',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.moderate','1499AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the MODERATE severity concept','a17c994d-09c0-4f93-9900-ebe32e4278d4',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.severity.severe','1500AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the SEVERE severity concept','ca7c945b-5fca-4791-8656-00e9b4e7b5ec',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.concept.unknown','1067AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA','UUID for the allergy unknown concept','e0615db5-2b9a-4d28-a8bd-393f563ab90d',NULL,NULL,NULL,NULL,NULL,NULL),('allergy.reaction.ConceptClasses','Symptom','A comma-separated list of the allowed concept classes for the reaction field of the allergy dialog','ebf55933-fe13-4ce5-89de-b76ff4fd0aec',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.mandatory','false','true/false whether or not the appframework module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','9ff9fa1a-9608-4bf2-95dc-41e7c3bd6533',NULL,NULL,NULL,NULL,NULL,NULL),('appframework.started','true','DO NOT MODIFY. true/false whether or not the appframework module has been started.  This is used to make sure modules that were running  prior to a restart are started again','79a00a7b-40ef-48a2-a3fa-bcb59e2a4dda',NULL,NULL,NULL,NULL,NULL,NULL),('application.name','OpenMRS','The name of this application, as presented to the user, for example on the login and welcome pages.','cbe43983-e0af-4a3d-a9d2-6399f6fa6824',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.mandatory','false','true/false whether or not the appointments module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','822b69dd-8295-46d1-8883-116939213429',NULL,NULL,NULL,NULL,NULL,NULL),('appointments.started','true','DO NOT MODIFY. true/false whether or not the appointments module has been started.  This is used to make sure modules that were running  prior to a restart are started again','e0093834-e462-4968-8767-cad52fdc84f2',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForAppointments','/openmrs/ws/rest/v1/appointments/{uuid}','URL pattern to use for published appointment events. Default is /openmrs/ws/rest/v1/appointments/{uuid}. If you change default value, please add your custom implementation for the given URL','929cbe1d-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForAppointmentService','/openmrs/ws/rest/v1/appointment-services/{uuid}','URL pattern to use for published appointment service events. Default is /openmrs/ws/rest/v1/appointment-services/{uuid}. If you change default value, please add your custom implementation for the given URL','929b899c-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForBedTagMap','/openmrs/ws/rest/v1/bedTagMap/{uuid}','URL pattern to use for published bed tag map events. Default is /openmrs/ws/rest/v1/bedTagMap/{uuid}. If you change default value, please add your custom implementation for the given URL.','8e78ee5e-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForPatientRelationshipChange','','URL pattern to use for published relationship events. Default is /openmrs/ws/rest/v1/relationship/%s','887f434b-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForProgramStateChange','','URL pattern to use for published program events. Default is /openmrs/ws/rest/v1/programenrollment/{uuid}?v=full','88a9073d-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForRecurringAppointments','/openmrs/ws/rest/v1/recurring-appointments?uuid={uuid}','URL pattern to use for published Recurring appointment events. Default is /openmrs/ws/rest/v1/recurring-appointments?uuid={uuid}. If you change default value, please add your custom implementation for the given URL','86603462-239b-11eb-95a2-080027c205d3',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForSurgicalAppointment','/openmrs/ws/rest/v1/surgicalAppointment/{uuid}?v=full','URL pattern to use for published surgical appointment events. Default is /openmrs/ws/rest/v1/surgicalAppointment/{uuid}?v=full. If you change default value, please add your custom implementation for the given URL','8f1aaeec-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.event.urlPatternForSurgicalBlock','/openmrs/ws/rest/v1/surgicalBlock/{uuid}?v=full','URL pattern to use for published surgical block events. Default is /openmrs/ws/rest/v1/surgicalBlock/{uuid}?v=full. If you change default value, please add your custom implementation for the given URL','8f194b8d-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForAppointments','true','If set true, events related to appointment changes are published','929c23e9-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForAppointmentService','true','If set true, events related to appointment service changes are published','929a6103-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForBedTagMapChange','true','If set true, events related to bed tag map changes are published','8e779ba3-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForPatientProgramStateChange','','If set true, events related to program changes are published','88a324c5-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForPatientRelationshipChange','','If set true, events related to relationship changes are published','887579ae-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForSurgicalAppointmentChange','true','If set true, events related to surgical appointment changes are published','8f1a004a-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('atomfeed.publish.eventsForSurgicalBlockChange','true','If set true, events related to surgical block changes are published','8f188175-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('auditlog.mandatory','false','true/false whether or not the auditlog module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','bcb4497c-646f-4943-91c6-22b9d9278ca6',NULL,NULL,NULL,NULL,NULL,NULL),('auditlog.started','true','DO NOT MODIFY. true/false whether or not the auditlog module has been started.  This is used to make sure modules that were running  prior to a restart are started again','d56890e1-b801-4371-afed-7ea663ea678a',NULL,NULL,NULL,NULL,NULL,NULL),('bacteriology.mandatory','false','true/false whether or not the bacteriology module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','27c3e167-ae9f-4563-9edf-4bd7bc95eaff',NULL,NULL,NULL,NULL,NULL,NULL),('bacteriology.started','true','DO NOT MODIFY. true/false whether or not the bacteriology module has been started.  This is used to make sure modules that were running  prior to a restart are started again','0b545d6b-1459-4ca7-b551-9d7deceb1822',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.appointments.runningOnOpenMRS',NULL,'If set to yes, the appointments ui will run independent of bahmni core','86558e59-239b-11eb-95a2-080027c205d3',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.cacheHeadersFilter.expiresDuration','0','Expires duration in minutes','672dc790-e0b6-11e3-8b68-0800200c9a66',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.enableAuditLog','true','Enable or disable audit log','b3102f9f-a978-403c-aa50-b651963cf4cf',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.encountersession.duration','60','Encountersession duration in minutes','7e40e716-e42f-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.encounterType.default','Consultation','Default Encounter Type','7fa2c0d3-e42f-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.extraPatientIdentifierTypes',NULL,'A list of UUIDs indicating extra Patient Identifier Types that should be displayed','d997a017-862c-4b73-962f-1faf06c93410',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.forms.directory','/home/bahmni/clinical_forms/','Filesystem path for saving the bahmni forms','09885ea0-28df-42de-aee5-e16564846e1d',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.formTranslations.directory','/home/bahmni/clinical_forms/translations','Filesystem path for saving the bahmni forms translations','8d510e3d-8857-431c-bf12-5e86aefba9c3',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.ie.apps.mandatory','false','true/false whether or not the bahmni.ie.apps module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','0d1f2777-b55a-4f69-adce-622e40f27bad',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.ie.apps.started','true','DO NOT MODIFY. true/false whether or not the bahmni.ie.apps module has been started.  This is used to make sure modules that were running  prior to a restart are started again','ad7c9ab2-2a7e-4af0-9dc1-3679407dbeaa',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.primaryIdentifierType','7dfc1a64-e42f-11e5-8c3e-08002715d519','Primary identifier type for looking up patients, generating barcodes, etc','247c96d7-59af-4864-8b7a-4d956d32a0cf',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.relationshipTypeMap',NULL,'Relationship Type Map format Eg:{ \"patient\": [\"Sibling\", \"Parent\"],\"provider\": [\"Doctor\"]}.If no value is specified default is  patient relationship.','448d2659-ad47-42e3-afa3-7ac49c03b7b8',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.pastAppointments','SELECT\n     app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\n     app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\n     DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\n     CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\n     CONCAT(pn.given_name, \' \', pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\n     pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\nFROM\n   patient_appointment pa\n   JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\n   JOIN appointment_service app_service\n     ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\n   LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\n   LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\n   LEFT JOIN appointment_service_type app_service_type\n     ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\n WHERE p.uuid = ${patientUuid} AND start_date_time < CURDATE() AND (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\n ORDER BY start_date_time DESC\n LIMIT 5;','Past appointments for patient','92984d50-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('bahmni.sqlGet.upComingAppointments','SELECT\n  app_service.name                                                                                AS `DASHBOARD_APPOINTMENTS_SERVICE_KEY`,\n  app_service_type.name                                                                           AS `DASHBOARD_APPOINTMENTS_SERVICE_TYPE_KEY`,\n  DATE_FORMAT(start_date_time, \"%d/%m/%Y\")                                                        AS `DASHBOARD_APPOINTMENTS_DATE_KEY`,\n  CONCAT(DATE_FORMAT(start_date_time, \"%l:%i %p\"), \" - \", DATE_FORMAT(end_date_time, \"%l:%i %p\")) AS `DASHBOARD_APPOINTMENTS_SLOT_KEY`,\n  CONCAT(pn.given_name, \' \', pn.family_name)                                                      AS `DASHBOARD_APPOINTMENTS_PROVIDER_KEY`,\n  pa.status                                                                                       AS `DASHBOARD_APPOINTMENTS_STATUS_KEY`\nFROM\n  patient_appointment pa\n  JOIN person p ON p.person_id = pa.patient_id AND pa.voided IS FALSE\n  JOIN appointment_service app_service\n    ON app_service.appointment_service_id = pa.appointment_service_id AND app_service.voided IS FALSE\n  LEFT JOIN provider prov ON prov.provider_id = pa.provider_id AND prov.retired IS FALSE\n  LEFT JOIN person_name pn ON pn.person_id = prov.person_id AND pn.voided IS FALSE\n  LEFT JOIN appointment_service_type app_service_type\n    ON app_service_type.appointment_service_type_id = pa.appointment_service_type_id\nWHERE p.uuid = ${patientUuid} AND\n      start_date_time >= CURDATE() AND\n      (app_service_type.voided IS FALSE OR app_service_type.voided IS NULL)\nORDER BY start_date_time ASC;','Upcoming appointments for patient','92992eca-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.mandatory','false','true/false whether or not the bahmnicore module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','873189b1-972a-4244-8084-85d98207bbcd',NULL,NULL,NULL,NULL,NULL,NULL),('bahmnicore.started','true','DO NOT MODIFY. true/false whether or not the bahmnicore module has been started.  This is used to make sure modules that were running  prior to a restart are started again','2293b5a8-b235-412f-9857-73203eb671a4',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.mandatory','false','true/false whether or not the bedmanagement module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','3bd0ab8a-8713-4ae2-a0dd-b637dbd3e9d2',NULL,NULL,NULL,NULL,NULL,NULL),('bedManagement.sqlGet.patientListForAdmissionLocation','SELECT\n  b.bed_number AS \'Bed\',\n  concat(pn.given_name, \' \', ifnull(pn.family_name,\'\')) AS \'Name\',\n  pi.identifier AS \'Id\',\n  pv.gender AS \'Gender\',\n  TIMESTAMPDIFF(YEAR, pv.birthdate, CURDATE()) AS \'Age\',\n  admission_provider_name.given_name AS \'Admission By\',\n  cast(DATE_FORMAT(latestAdmissionEncounter.max_encounter_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Admission Time\',\n  adtNotes.value_text AS \'ADT Notes\',\n  dispositionInfo.providerName AS \'Disposition By\',\n  cast(DATE_FORMAT(dispositionInfo.providerDate, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Disposition Time\',\n  diagnosis.diagnosisConcept AS \'Diagnosis\',\n  diagnosis.certainty AS \'Diagnosis Certainty\',\n  diagnosis.diagnosisOrder AS \'Diagnosis Order\',\n  diagnosis.status AS \'Diagnosis Status\',\n  diagnosis.diagnosis_provider AS \'Diagnosis Provider\',\n  cast(DATE_FORMAT(diagnosis.diagnosis_datetime, \'%d %b %y %h:%i %p\') AS CHAR) AS \'Diagnosis Datetime\'\nFROM bed_location_map blm\n  INNER JOIN bed b\n    ON blm.bed_id = b.bed_id AND b.status = \'OCCUPIED\'\n  INNER JOIN location l on blm.location_id = l.location_id and l.name = ${location_name}\n  INNER JOIN bed_patient_assignment_map bpam ON b.bed_id = bpam.bed_id AND date_stopped IS NULL\n  INNER JOIN person pv ON pv.person_id = bpam.patient_id\n  INNER JOIN person_name pn ON pn.person_id = pv.person_id\n  INNER JOIN patient_identifier pi ON pv.person_id = pi.patient_id\n  INNER JOIN patient_identifier_type pit on pi.identifier_type = pit.patient_identifier_type_id\n  INNER JOIN global_property gp on gp.property=\'bahmni.primaryIdentifierType\' and gp.property_value=pit.uuid\n  INNER JOIN (\n        SELECT patient_id, max(encounter_datetime) AS max_encounter_datetime,\n          max(visit_id) as visit_id, max(encounter_id) AS encounter_id\n        FROM encounter INNER JOIN encounter_type ON encounter_type.encounter_type_id = encounter.encounter_type\n        WHERE encounter_type.name = \'ADMISSION\'\n        GROUP BY patient_id) latestAdmissionEncounter\n      ON pv.person_id = latestAdmissionEncounter.patient_id\n  LEFT OUTER JOIN obs adtNotes\n    ON adtNotes.encounter_id = latestAdmissionEncounter.encounter_id\n    AND adtNotes.voided = 0\n    AND adtNotes.concept_id = (SELECT concept_id\n                              FROM concept_name\n                              WHERE name = \'Adt Notes\' AND concept_name_type = \'FULLY_SPECIFIED\' AND locale = \'en\')\n  LEFT OUTER JOIN encounter_provider ep ON ep.encounter_id = latestAdmissionEncounter.encounter_id\n  LEFT OUTER JOIN provider admission_provider ON admission_provider.provider_id = ep.provider_id\n  LEFT OUTER JOIN person_name admission_provider_name\n    ON admission_provider_name.person_id = admission_provider.person_id\n  LEFT OUTER JOIN (\n        SELECT\n          bpam.patient_id AS person_id,\n          concept_name.name AS disposition,\n          latestDisposition.obs_datetime AS providerDate,\n          person_name.given_name AS providerName\n        FROM bed_patient_assignment_map bpam\n          INNER JOIN (SELECT person_id, max(obs_id) obs_id\n                      FROM obs WHERE concept_id = (SELECT concept_id\n                          FROM concept_name\n                          WHERE name = \'Disposition\' AND concept_name_type = \'FULLY_SPECIFIED\' AND locale = \'en\')\n                      GROUP BY person_id)\n                maxObsId ON maxObsId.person_id = bpam.patient_id\n          INNER JOIN obs latestDisposition\n            ON maxObsId.obs_id = latestDisposition.obs_id AND latestDisposition.voided = 0\n          INNER JOIN concept_name ON latestDisposition.value_coded = concept_name.concept_id AND\n                                     concept_name_type = \'FULLY_SPECIFIED\'\n          LEFT OUTER JOIN encounter_provider ep ON latestDisposition.encounter_id = ep.encounter_id\n          LEFT OUTER JOIN provider disp_provider ON disp_provider.provider_id = ep.provider_id\n          LEFT OUTER JOIN person_name ON person_name.person_id = disp_provider.person_id\n        WHERE bpam.date_stopped IS NULL\n    ) dispositionInfo ON pv.person_id = dispositionInfo.person_id\n  LEFT OUTER JOIN (\n    SELECT\n      diagnosis.person_id AS person_id,\n      diagnosis.obs_id AS obs_id,\n      diagnosis.obs_datetime AS diagnosis_datetime,\n      if(diagnosisConceptName.name IS NOT NULL, diagnosisConceptName.name, diagnosis.value_text) AS diagnosisConcept,\n      certaintyConceptName.name AS certainty,\n      diagnosisOrderConceptName.name AS diagnosisOrder,\n      diagnosisStatusConceptName.name AS status,\n      person_name.given_name AS diagnosis_provider\n    FROM bed_patient_assignment_map bpam\n      INNER JOIN visit latestVisit\n        ON latestVisit.patient_id = bpam.patient_id AND latestVisit.date_stopped IS NULL\n        AND bpam.date_stopped IS NULL\n      INNER JOIN encounter ON encounter.visit_id = latestVisit.visit_id\n      INNER JOIN obs diagnosis ON bpam.patient_id = diagnosis.person_id AND diagnosis.voided = 0 AND\n          diagnosis.encounter_id = encounter.encounter_id AND\n          diagnosis.concept_id IN (\n            SELECT concept_id FROM concept_name\n            WHERE name IN (\'Coded Diagnosis\', \'Non-Coded Diagnosis\')\n              AND concept_name_type = \'FULLY_SPECIFIED\' )\n      LEFT OUTER JOIN concept_name diagnosisConceptName\n        ON diagnosis.value_coded IS NOT NULL\n        AND diagnosis.value_coded = diagnosisConceptName.concept_id\n        AND diagnosisConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n        AND diagnosisConceptName.locale =\'en\'\n      LEFT OUTER JOIN encounter_provider ep ON diagnosis.encounter_id = ep.encounter_id\n      LEFT OUTER JOIN provider diagnosis_provider ON diagnosis_provider.provider_id = ep.provider_id\n      LEFT OUTER JOIN person_name ON person_name.person_id = diagnosis_provider.person_id\n      INNER JOIN obs certainty\n        ON diagnosis.obs_group_id = certainty.obs_group_id AND certainty.voided = 0\n        AND certainty.concept_id = (\n          SELECT concept_id FROM concept_name\n          WHERE name = \'Diagnosis Certainty\'\n          AND concept_name_type = \'FULLY_SPECIFIED\'\n          AND locale = \'en\')\n      LEFT OUTER JOIN concept_name certaintyConceptName\n        ON certainty.value_coded IS NOT NULL\n        AND certainty.value_coded = certaintyConceptName.concept_id\n        AND certaintyConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n        AND certaintyConceptName.locale = \'en\'\n      INNER JOIN obs diagnosisOrder\n        ON diagnosis.obs_group_id = diagnosisOrder.obs_group_id AND diagnosisOrder.voided = 0\n        AND diagnosisOrder.concept_id = (\n          SELECT concept_id FROM concept_name\n          WHERE name = \'Diagnosis order\' AND concept_name_type = \'FULLY_SPECIFIED\' and locale =\'en\')\n      LEFT OUTER JOIN concept_name diagnosisOrderConceptName\n        ON diagnosisOrder.value_coded IS NOT NULL\n        AND diagnosisOrder.value_coded = diagnosisOrderConceptName.concept_id\n        AND diagnosisOrderConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n        AND diagnosisOrderConceptName.locale = \'en\'\n      LEFT JOIN obs diagnosisStatus\n        ON diagnosis.obs_group_id = diagnosisStatus.obs_group_id AND diagnosisStatus.voided = 0\n        AND diagnosisStatus.concept_id = (\n          SELECT concept_id FROM concept_name\n          WHERE name = \'Bahmni Diagnosis Status\'\n          AND concept_name_type = \'FULLY_SPECIFIED\'\n          AND locale = \'en\')\n      LEFT OUTER JOIN concept_name diagnosisStatusConceptName\n        ON diagnosisStatus.value_coded IS NOT NULL\n        AND diagnosisStatus.value_coded = diagnosisStatusConceptName.concept_id\n        AND diagnosisStatusConceptName.concept_name_type = \'FULLY_SPECIFIED\'\n        AND diagnosisStatusConceptName.locale = \'en\'\n) diagnosis ON diagnosis.person_id = pv.person_id;','Sql query to get admitted patients details in an Admission Location','91b24347-2629-11ea-a712-06fd739536ce',NULL,NULL,NULL,NULL,NULL,NULL),('bedmanagement.started','true','DO NOT MODIFY. true/false whether or not the bedmanagement module has been started.  This is used to make sure modules that were running  prior to a restart are started again','99871c23-1568-4979-8979-54ed1ab8ba48',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.mandatory','false','true/false whether or not the calculation module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','8028ce6a-3e93-4023-9785-4492b4d2226a',NULL,NULL,NULL,NULL,NULL,NULL),('calculation.started','true','DO NOT MODIFY. true/false whether or not the calculation module has been started.  This is used to make sure modules that were running  prior to a restart are started again','0e541ae2-daaa-40be-b792-78c91b4f6ebf',NULL,NULL,NULL,NULL,NULL,NULL),('concept.causeOfDeath','5002','Concept id of the concept defining the CAUSE OF DEATH concept','446ebec3-3cc6-43c7-8958-7c6137060833',NULL,NULL,NULL,NULL,NULL,NULL),('concept.defaultConceptMapType','NARROWER-THAN','Default concept map type which is used when no other is set','4c362c89-d2e1-4cc2-913f-76d73884dd22',NULL,NULL,NULL,NULL,NULL,NULL),('concept.false','2','Concept id of the concept defining the FALSE boolean concept','bfe79ec7-e55e-4202-88b5-e33e860056e2',NULL,NULL,NULL,NULL,NULL,NULL),('concept.height','5090','Concept id of the concept defining the HEIGHT concept','ed3bd72b-4954-4268-9658-c8954b70c579',NULL,NULL,NULL,NULL,NULL,NULL),('concept.medicalRecordObservations','1238','The concept id of the MEDICAL_RECORD_OBSERVATIONS concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','57da780c-41af-4b32-94b9-e0e92016c075',NULL,NULL,NULL,NULL,NULL,NULL),('concept.none','1107','Concept id of the concept defining the NONE concept','cf76ce46-a457-42f8-a10c-93fe35c88b5f',NULL,NULL,NULL,NULL,NULL,NULL),('concept.otherNonCoded','5622','Concept id of the concept defining the OTHER NON-CODED concept','77f2e970-550e-480e-80ea-e783f08ef7d0',NULL,NULL,NULL,NULL,NULL,NULL),('concept.patientDied','1742','Concept id of the concept defining the PATIENT DIED concept','1f3a3dc4-7ec8-4ff8-b134-86728f4cb84d',NULL,NULL,NULL,NULL,NULL,NULL),('concept.problemList','1284','The concept id of the PROBLEM LIST concept.  This concept_id is presumed to be the generic grouping (obr) concept in hl7 messages.  An obs_group row is not created for this concept.','4bf79ff4-3d99-4771-8fc3-fca08acc5be5',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonExitedCare',NULL,'Concept id of the concept defining the REASON EXITED CARE concept','3f2f8b7c-f5ec-412b-9897-1d7b62543f59',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonForDeath','','Fully Specified name of the Concept Set created as Reasons for death','7fb96596-e42f-11e5-8c3e-08002715d519',NULL,NULL,NULL,NULL,NULL,NULL),('concept.reasonOrderStopped','1812','Concept id of the concept defining the REASON ORDER STOPPED concept','10a59ed0-085f-48f6-9e41-49359e042ae5',NULL,NULL,NULL,NULL,NULL,NULL),('concept.true','1','Concept id of the concept defining the TRUE boolean concept','c3586f75-5fc8-47e4-beb6-209cf0dd4dff',NULL,NULL,NULL,NULL,NULL,NULL),('concept.weight','5089','Concept id of the concept defining the WEIGHT concept','839e9b1d-c0e6-4bba-a99c-1a93fd8611b3',NULL,NULL,NULL,NULL,NULL,NULL),('conceptDrug.dosageForm.conceptClasses',NULL,'A comma-separated list of the allowed concept classes for the dosage form field of the concept drug management form.','c974eb42-416f-4485-be66-e28a50d6391d',NULL,NULL,NULL,NULL,NULL,NULL),('conceptDrug.route.conceptClasses',NULL,'A comma-separated list of the allowed concept classes for the route field of the concept drug management form.','91626580-b3d6-43d6-a98b-bfc37e999d20',NULL,NULL,NULL,NULL,NULL,NULL),('concepts.locked','false','if true, do not allow editing concepts','3606f833-27ee-4a45-8afc-a4517e672a96','org.openmrs.customdatatype.datatype.BooleanDatatype',NULL,NULL,NULL,NULL,NULL),('concept_map_type_management.enable','false','Enables or disables management of concept map types','68db8334-eff3-45d4-983e-e21c2aec5127','org.openmrs.customdata